/** @format */
import React, { Fragment, useState, useEffect } from "react";
import { connect } from "react-redux";
import PropTypes from "prop-types";

import { getCurrentVideo } from "../actions/Video";
const Dashboard = ({ getCurrentVideo, auth, Video }) => {
  useEffect(() => {
    getCurrentVideo();
  }, []);

  return (
    <Fragment>
      <h4 style={{ textAlign: "center" }}> Welcome , Here is Our dashboard</h4>
      <div className="footerspace"></div>
    </Fragment>
  );
};

Dashboard.prototypes = {
  getCurrentVideo: PropTypes.func.isRequired,
  auth: PropTypes.object.isRequired,
  Video: PropTypes.object.isRequired,
};
const mapStateToProps = (state) => ({
  Video: state.Video,
  auth: state.auth,
});
export default connect(mapStateToProps, { getCurrentVideo })(Dashboard);
